import React, { Component } from 'react';

class RestartGame extends Component {
  constructor(props) {
    super(props);
    // Don't need real time to modify the buttons.
    this.state = {
      characters: this.props.characters
    };
  }

  render() {
    return (
      <h1>RestartGame</h1>
    );
  }
}

export default RestartGame;
